/**
 * @title  IMPRESSION D'UN DOCUMENT PDF
 * @description Impression d'un fichier sous format PDF / base64
 * @service DocumentPrinting (DocumentPrinter)
 * 
*/

/**
 * non valable param {file} pdf64 - Default: pdf - Fichier PDF en base64 - & restester si on récupère les droits de lire un fichier depuis l'application
 */

/**
 * Contenu Pdf du document à imprimer
 * Charset à préciser. L'encodage par défaut de la fonction printRawPdf() est iso-8859-1.
 */
let pdf64 = "";


function start1(){
    console.log("START - Lancement de l'impression du document");
    Kiosk.DocumentPrinting.addEventListener("rawPdfPrint", onRawPdfPrint);
    Kiosk.DocumentPrinting.printRawPdf({
        raw: pdf64
    });

}

function stop1(){
    console.log("STOP - Arret de l'impression du document");
    Kiosk.DocumentPrinting.removeEventListener("rawPdfPrint", onRawPdfPrint);
}

/**
* Fonction de rappel associée à l'événement d'impression de document
*/
function onRawPdfPrint(e) {
	console.log(e.data.dataType);
	switch (e.data.dataType) {
		case 'RawPdfPrinted':
			console.log("END - Document imprimé");
    		Kiosk.DocumentPrinting.removeEventListener("rawPdfPrint", onRawPdfPrint);
			break;
		case 'RawPdfPrintError':
			console.error("ERROR - " + e.data.code + ": " + e.data.description);
			break;
	}

	// Fin d'écoute de l'événement d'impression
	Kiosk.DocumentPrinting.removeEventListener('rawPdfPrint', onRawPdfPrint);
}
